import React, { useEffect, useState } from "react";

const ExamTopicMappingView = () => {
    const [data, setData] = useState("");
    const [topicData,setTopicData]=useState("");

    async function ExamDetails(){
        console.log("Exam details called.....");
        const response= await fetch("https://localhost:8443/onlineexam/control/examTopicMappingMasterEvent");
    
        const text=await response.json();
        console.log("this is the event message",text._EVENT_MESSAGE_);
        setData(text._EVENT_MESSAGE_);
      }
    
      useEffect(() => {
        ExamDetails();
      }, []);

  return (
    <div className="container">
      <div>
        <table className="table table-striped">
          <thead>
            <tr>
              <th>ExamId</th>
              <th>TopicId</th>
              <th>Percentage</th>
              <th>Topic Pass Percentage</th>
              <th>Questions Per Exam</th>
              <th></th>
              <th></th>
              <th></th>
              {/* <td>
                      <button className="btn btn-primary">
                        View Questions
                      </button>
                    </td>
                    <td>
                      <button className="btn btn-primary">
                        Add Another Topic
                      </button>
                    </td>
                    <td>
                      <button className="btn btn-danger">Delete</button>
                    </td> */}
            </tr>
          </thead>

          <tbody>
            {data
                 ? data.map((obj, value) => {
                  <tr>
                    <td>{obj.examId}</td>
                    <td>{obj.topicId}</td>
                    <td>{obj.percentage}</td>
                    <td>{obj.topicPassPercentage}</td>
                    
                  </tr>;
                })
              : ""}
          </tbody>
        </table>
      </div>
    </div>
  );
};

export default ExamTopicMappingView;
